  input: 'TEXT,F3T,,"Termination Plan:    As of today, the campaign bank account has
    a total of $843.57 in cash with no debts or unpaid bills that we are aware of.  The
    only noncash asset is a laptop PC, which we intend to donate to Shoreline Christian
    Church in San Diego.  Our plan for the remaining cash is to  pay our volunteer
    Office Manager another $500 (we previously gave her $2,500 on April 14), give
    $200 another volunteer, Ellen Maline, who to date has not received anything, and
    with the remaining $143.57, purchase a $143.57 gift card for a third volunteer
    Douglas Hix,, who also has not received anything to date for his services.   Both
    of the previously unpaid volunteers put in signficiant hours of their time on
    behalf of the campaign. Thank you for your consideration of our termination plan."'
